var amount = 0; // got to Shop page
this.shopPage.shopNavTab.click();
this.data.productName.forEach(function (productName) {
  return cy.addPhoneToCart(productName);
});
this.shopPage.checkOutBtn.click(); // get the product rows slice table remove last 2 rows
this.shopPage.allTableRows.then(function (rows) {
  rows = rows.slice(0, rows.length - 2);
  rows.each(function (i, el) {
    var total = el.querySelector("td:nth-child(4) strong") && el.querySelector("td:nth-child(4) strong").innerText;
    total = parseFloat(total.replace(/\.|₹/g, "").trim());
    amount += total;
  });
});
this.shopPage.allTableRows.then(function (rows) {
  var row = rows[rows.length - 2];
  var grandTotal = row.querySelector("td:last-of-type h3 strong").innerText;
  grandTotal = parseFloat(grandTotal.replace(/\.|₹/g, "").trim());
  expect(amount).equal(grandTotal);
});

